import React, { useState, useEffect } from 'react';

function GuestPage() {
    const [screeningsData, setScreeningsData] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8080/screenings/allScreenings')
            .then(response => response.json())
            .then(data => setScreeningsData(data))
            .catch(error => console.error(error));
    }, []);

    return (
        <div className="guest-page">
            {/* Background image (optional) */}
            <img src="..." alt="Cinema background" className="background-image" />

            <div className="screening-container">
                <h1>Welcome as Guest</h1>
                <h2>Screenings:</h2>
                {screeningsData.map(screening => (
                    <div key={screening.id} className="screening">
                        <img src={screening.movie.picUrl} alt={screening.movie.movieName} className="movie-poster" />
                        <div className="screening-info">
                            <h3>{screening.movie.movieName}</h3>
                            <p>Genre: {screening.movie.genre}</p>
                            <p>Release Year: {screening.movie.releaseYear}</p>
                            {/* ... other screening details */}
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default GuestPage;
